import React from 'react';
import '../../App.css';
import './Exams.css';

import Autocomplete from '@material-ui/lab/Autocomplete';
import TextField from '@material-ui/core/TextField';

export default function Exams() {
  const options = ['Monday', 'Tuesday', 'Thursday',
    'Friday', 'Saturday', 'Sunday']


  return (
    <div className='content'>
      <div className='fillter-option'>
        <select>
          {Object.values(options).map((value, index) => {
            return (
              <div key={index}>

                <option>{value}</option>

              </div>
            );
          })}
        </select>

        <select>
          <option>Môn Hoá</option>
          <option>Môn Toán</option>
        </select>

        <select>
          <option>Lớp 1</option>
          <option>Lớp 2</option>
        </select>

        <select>
          <option>Lớp 1</option>
          <option>Lớp 2</option>
        </select>

        <nav>
          <a>
          <Autocomplete
            options={options}

            className='combobox-content'
            renderInput={(params) =>
              <TextField {...params} label="Lớp" variant="outlined" />}
          />
          </a>
          <a>
          <Autocomplete
            options={options}
            className='combobox-content'
            renderInput={(params) =>
              <TextField {...params} label="Lớp" variant="outlined" />}
          />
          </a>
        </nav>
        
      </div>
      
    </div>
  );
}
